import React from "react";
import AboutUsHome from "./AboutUsHome";
import WhoWeAre from "./WhoWeAre";
import Footer2 from "./Footer2";

function AboutUs() {
  return (
    <div>
      <AboutUsHome />
      <WhoWeAre />
      <Footer2 />>
    </div>
  );
}

export default AboutUs;
